import {
  Box,
  Button,
  CardContent,
  CircularProgress,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  TablePagination
} from "@material-ui/core";
import React, { useEffect, useState } from "react";

import api from  "../service/api";

export const AppList = () => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    api.get("usuarios", ).then(response => {
      setUsers(response.data);
    });
  }, );


  return (
    <div>
      <ul>
        {users.map(incident => (
          <li key={incident.id}>
            <strong>Caso:</strong>
            <p>{incident.email}</p>


        </li>
      ))}
    </ul>

    </div>
  );
};
